sys_variable_value.value:
(function execute(inputs, outputs) {
    if (!inputs.external_content_table || inputs.external_content_table.trim() == '') {
        outputs.status = 'Error';
        outputs.error_message = 'Invalid external content table.';
        return;
    }

    if (!inputs.document_id || inputs.document_id.trim() == '') {
        outputs.status = 'Error';
        outputs.error_message = 'Invalid document id.';
        return;
    }

    if (!inputs.batcher_id || inputs.batcher_id.trim() == '') {
        outputs.status = 'Error';
        outputs.error_message = 'Invalid batcher id.';
        return;
    }

    if (!inputs.properties || !new sn_ais_spoke.AISSpokeUtil().isJson(inputs.properties)) {
        outputs.status = 'Error';
        outputs.error_message = 'Invalid properties.';
        return;
    }

    try {
        var externalTableName = inputs.external_content_table.trim();
        var externalDocumentID = inputs.document_id.trim();
        var batcherID = inputs.batcher_id.trim();
        var properties = JSON.parse(inputs.properties);
        var contentPointer = inputs.content_pointer;

        var externalIngestionApi = new sn_ais_ec.SearchExternalContentIngestionApi();
      	var response = null;

        // If principals are passed use the correct method
        if (inputs.principals) {
          	if(!new sn_ais_spoke.AISSpokeUtil().isJson(inputs.principals)) {
              outputs.status = 'Error';
              outputs.error_message = 'Invalid principals:' + inputs.principals.toString();
              return; 
          	}
          	var principals = JSON.parse(inputs.principals);
        	response = externalIngestionApi.ingestDocumentWithPrincipal(externalTableName, externalDocumentID, properties, contentPointer, batcherID, principals);
        } else {
          gs.info("svntst prop "+JSON.stringify(properties));
          	response = externalIngestionApi.ingestDocument(externalTableName, externalDocumentID, properties, contentPointer, batcherID);
        }

      	if (!response) {
            outputs.status = 'Error';
            outputs.error_message = 'Error occurred while ingesting properties into the batcher.';
            return;
        }
        outputs.status = 'Success';
    } catch (e) {
        outputs.status = 'Error';
        outputs.error_message = 'Encountered an error. Check log for more details.';
        gs.error(e);
    }
})(inputs, outputs);

